INSERT INTO `batch_exec_record` VALUES (1, '134', '2021-08-18 21:04:54.517521', 'https://dialogflow.cloud.google.com/#/agent/expo-9cuf/editIntent/137c7bb5-2001-4999-ad2b-395934237094/&&https://dialogflow.cloud.google.com/#/agent/expo-9cuf/editIntent/160c0164-2518-4cc8-8af3-e97049ecc35d/&&https://dialogflow.cloud.google.com/#/agent/expo-9cuf/editIntent/38710a2c-81fa-40c4-88f3-df2ac7bbf97e/&&https://dialogflow.cloud.google.com/#/agent/expo-9cuf/editIntent/3e681d04-cbbc-4d29-846a-8728be408e83/&&https://dialogflow.cloud.google.com/#/agent/expo-9cuf/editIntent/4a6f7f46-7306-4188-8c98-86328774458e/&&https://dialogflow.cloud.google.com/#/agent/expo-9cuf/editIntent/70b598e2-e5c2-4e3c-aa23-d41cca1cbd97/&&https://dialogflow.cloud.google.com/#/agent/expo-9cuf/editIntent/7be13bde-9c92-4094-918b-bcd83736a9a2/&&https://dialogflow.cloud.google.com/#/agent/expo-9cuf/editIntent/a4d6d377-06e7-48ca-ab44-7097ac4cc62f/&&https://dialogflow.cloud.google.com/#/agent/expo-9cuf/editIntent/cdd56a55-4213-41d0-92c3-4bcd08d4d81f/&&https://dialogflow.cloud.google.com/#/agent/expo-9cuf/editIntent/e6a99682-0a96-4f5e-808a-ba882c2f0e12/&&https://dialogflow.cloud.google.com/#/agent/expo-9cuf/editIntent/f07fc6f0-d3cb-4d5a-8219-7f7f81b4b432/&&https://dialogflow.cloud.google.com/#/agent/expo-9cuf/editIntent/f21d7171-7b4f-47ec-96da-bd295758e51f/', '中国-东盟博览会介绍&&东博会第十一届是哪年&&既是经贸盛会也是外交舞台体现在哪&&东博会主办是哪&&怎么让投资与引资相结合&&怎么让商品贸易与服务贸易相结合 &&东博会对推动多领域合作起到哪些作用&&经贸活动与文化交流相结合怎么体现&&怎么让进口与出口相结合&&怎么让展会结合&&广西承办的国际经贸盛会起到了哪些意义&&东博会第第十二届是哪年', '中国-东盟博览会（China-ASEAN Expo 简称CAEXPO），简称东博会，由中国前国务院总理温家宝倡议，由中国和东盟10国经贸主管部门及东盟秘书处共同主办，广西壮族自治区人民政府承办的国家级、国际性经贸交流盛会，每年在广西壮族自治区南宁举办。&&第十一届中国－东盟博览会2014年举办。&&传导中国—东盟自由贸易区商机，传递中国—东盟友好合作的信号 。&&是中国和东盟10国政府经贸主管部门及东盟秘书处共同主办。&&落实中国—东盟自由贸易区《投资协议》 ，以中国企业“走出去”为特色 ，做中国企业投资东盟的平台 。&&紧扣中国—东盟自由贸易区《货物贸易协议》和《服务贸易协议》，促进降税商品交易，推动服务贸易合作。&&东博会根据“一带一路”建设需要举办一系列会议论坛，涵盖海关、检验检疫、金融、港口、物流、文化、科技、教育等40多个领域，实现了部长级磋商以及政府官员、企业家、专家学者、社会各界知名人士之间的对话沟通，建立起多领域合作机制，带动了中国—东盟信息港、中国—东盟港口城市合作网络、中国—东盟技术转移中心、中国—东盟企业家联合会、中国—东盟青年联谊会、中国—东盟教育培训中心等重大项目落地，成为了中国—东盟多领域合作的权威性较强、认可度较高的“南宁渠道”。&&经贸活动之余，中国—东盟汽车拉力赛、中国—东盟高尔夫国际邀请赛、南宁国际民歌艺术节等文化体育活动穿插其间，精彩纷呈。&&以进口为特色，强调对东盟市场开放 ，做东盟商品进入中国的桥梁。&&会期既有展览、洽谈、推介、签约等活动，又有政府官员、企业家、专家学者参加的高层论坛。“展”和“会”相互促进，交相辉映。&&推动并见证了中国—东盟战略伙伴关系内涵的不断丰富，经贸合作水平的迅速提升，人文民间交往的日益密切。&&第12届东博会于2015年在南宁举办。', '{\"name\": \"projects/expo-9cuf/operations/bg-644cf861-a791-4b87-b9d0-5bec6043136c\", \"done\": true, \"response\": {\"@type\": \"type.googleapis.com/google.protobuf.Empty\"}}', '{\"exec_param\": {\"dialogflow_config\": {\"request_frequency\": 3, \"intent_name_prefix\": \"\\u610f\\u56fe\\u524d\\u7f00\", \"project_id\": \"expo-9cuf\", \"language_code\": \"en\"}, \"runtime_param\": {\"phrases_parts\": \"\", \"response_texts\": \"\"}}}');
