INSERT INTO `dialogflow_exec_record` VALUES (00000000308, '2021-08-19 15:51:22.064675', '东博会第第十二届是哪年&&东博会第十二届是什么时候&&东博会第十二届是哪年举办的', '第12届东博会于2015年在南宁举办。', '{\"name\": \"projects/expo-9cuf/agent/intents/2f47b5d8-9f22-40d8-9d09-139ff4bfd81b\", \"displayName\": \"x_0_12\", \"priority\": 500000, \"mlEnabled\": true, \"messages\": [{\"text\": {\"text\": [\"第12届东博会于2015年在南宁举办。\"]}}]}', 'https://dialogflow.cloud.google.com/#/agent/expo-9cuf/editIntent/2f47b5d8-9f22-40d8-9d09-139ff4bfd81b/', '134', '{\"exec_param\": {\"dialogflow_config\": {\"request_frequency\": 3, \"intent_name_prefix\": \"x_0\", \"project_id\": \"expo-9cuf\", \"language_code\": \"zh-cn\"}, \"runtime_param\": {\"ID\": 12, \"phrases_parts\": [\"东博会第第十二届是哪年\", \"东博会第十二届是什么时候\", \"东博会第十二届是哪年举办的\"], \"response_texts\": [\"第12届东博会于2015年在南宁举办。\"]}}}');
INSERT INTO `dialogflow_exec_record` VALUES (00000000309, '2021-08-19 17:22:22.604086', '中国-东盟博览会介绍&&介绍一下中国-东盟博览会&&中国-东盟博览会简介&&介绍一下博览会', '中国-东盟博览会（China-ASEAN Expo 简称CAEXPO），简称东博会，由中国前国务院总理温家宝倡议，由中国和东盟10国经贸主管部门及东盟秘书处共同主办，广西壮族自治区人民政府承办的国家级、国际性经贸交流盛会，每年在广西壮族自治区南宁举办。', '{\"name\": \"projects/expo-9cuf/agent/intents/ed56613d-3332-4aa0-b5d7-2d2f67dede09\", \"displayName\": \"x_0_0_1\", \"priority\": 500000, \"mlEnabled\": true, \"messages\": [{\"text\": {\"text\": [\"中国-东盟博览会（China-ASEAN Expo 简称CAEXPO），简称东博会，由中国前国务院总理温家宝倡议，由中国和东盟10国经贸主管部门及东盟秘书处共同主办，广西壮族自治区人民政府承办的国家级、国际性经贸交流盛会，每年在广西壮族自治区南宁举办。\"]}}]}', 'https://dialogflow.cloud.google.com/#/agent/expo-9cuf/editIntent/ed56613d-3332-4aa0-b5d7-2d2f67dede09/', '134', '{\"exec_param\": {\"dialogflow_config\": {\"request_frequency\": 3, \"intent_name_prefix\": \"x_0_0\", \"project_id\": \"expo-9cuf\", \"language_code\": \"zh-cn\"}, \"runtime_param\": {\"ID\": 1, \"phrases_parts\": [\"中国-东盟博览会介绍\", \"介绍一下中国-东盟博览会\", \"中国-东盟博览会简介\", \"介绍一下博览会\"], \"response_texts\": [\"中国-东盟博览会（China-ASEAN Expo 简称CAEXPO），简称东博会，由中国前国务院总理温家宝倡议，由中国和东盟10国经贸主管部门及东盟秘书处共同主办，广西壮族自治区人民政府承办的国家级、国际性经贸交流盛会，每年在广西壮族自治区南宁举办。\"]}}}');
