INSERT INTO `dialogflow_exec_record` VALUES (00000000311, '2021-08-19 17:22:30.184159', '中国-东盟博览会的背景&&介绍一下中国-东盟博览会的背景&&介绍一下大会的背景', '2003年10月8日，中国国务院总理温家宝在第七次中国与东盟（10+1）领导人会议上倡议，从2004年起每年在中国南宁举办中国—东盟博览会，同期举办中国—东盟商务与投资峰会。这一倡议得到了东盟10国领导人的普遍欢迎。', '{\"name\": \"projects/expo-9cuf/agent/intents/66fa1cc3-7a38-4373-b866-bd139ec73427\", \"displayName\": \"x_0_0_3\", \"priority\": 500000, \"mlEnabled\": true, \"messages\": [{\"text\": {\"text\": [\"2003年10月8日，中国国务院总理温家宝在第七次中国与东盟（10+1）领导人会议上倡议，从2004年起每年在中国南宁举办中国—东盟博览会，同期举办中国—东盟商务与投资峰会。这一倡议得到了东盟10国领导人的普遍欢迎。\"]}}]}', 'https://dialogflow.cloud.google.com/#/agent/expo-9cuf/editIntent/66fa1cc3-7a38-4373-b866-bd139ec73427/', '134', '{\"exec_param\": {\"dialogflow_config\": {\"request_frequency\": 3, \"intent_name_prefix\": \"x_0_0\", \"project_id\": \"expo-9cuf\", \"language_code\": \"zh-cn\"}, \"runtime_param\": {\"ID\": 3, \"phrases_parts\": [\"中国-东盟博览会的背景\", \"介绍一下中国-东盟博览会的背景\", \"介绍一下大会的背景\"], \"response_texts\": [\"2003年10月8日，中国国务院总理温家宝在第七次中国与东盟（10+1）领导人会议上倡议，从2004年起每年在中国南宁举办中国—东盟博览会，同期举办中国—东盟商务与投资峰会。这一倡议得到了东盟10国领导人的普遍欢迎。\"]}}}');
INSERT INTO `dialogflow_exec_record` VALUES (00000000312, '2021-08-19 17:22:34.067788', '中国-东盟博览会的定位&&什么是中国-东盟博览会的定位&&大会的定位是什么', '以促进中国—东盟自由贸易区建设，共享合作与发展机遇为宗旨，围绕《中国与东盟全面经济合作框架协议》以双向互利为原则，以自由贸易区内的经贸合作为重点，面向全球开放，为各国商家共同发展提供新的机遇。', '{\"name\": \"projects/expo-9cuf/agent/intents/39a97e65-223e-4bca-be7f-5c03a353ce4c\", \"displayName\": \"x_0_0_4\", \"priority\": 500000, \"mlEnabled\": true, \"messages\": [{\"text\": {\"text\": [\"以促进中国—东盟自由贸易区建设，共享合作与发展机遇为宗旨，围绕《中国与东盟全面经济合作框架协议》以双向互利为原则，以自由贸易区内的经贸合作为重点，面向全球开放，为各国商家共同发展提供新的机遇。\"]}}]}', 'https://dialogflow.cloud.google.com/#/agent/expo-9cuf/editIntent/39a97e65-223e-4bca-be7f-5c03a353ce4c/', '134', '{\"exec_param\": {\"dialogflow_config\": {\"request_frequency\": 3, \"intent_name_prefix\": \"x_0_0\", \"project_id\": \"expo-9cuf\", \"language_code\": \"zh-cn\"}, \"runtime_param\": {\"ID\": 4, \"phrases_parts\": [\"中国-东盟博览会的定位\", \"什么是中国-东盟博览会的定位\", \"大会的定位是什么\"], \"response_texts\": [\"以促进中国—东盟自由贸易区建设，共享合作与发展机遇为宗旨，围绕《中国与东盟全面经济合作框架协议》以双向互利为原则，以自由贸易区内的经贸合作为重点，面向全球开放，为各国商家共同发展提供新的机遇。\"]}}}');
