INSERT INTO `dialogflow_exec_record` VALUES (00000000319, '2021-08-19 17:23:00.409502', '“东盟”的由来&&介绍一下“东盟”&&“东盟”简介', '“东盟”是“东南亚国家联盟”的简称，英文名称为Association of Southeast Asian Nations&& 简称ASEAN。1967年8月7日～8日，印尼、泰国、新加坡、菲律宾四国外长和马来西亚副总理在曼谷举行会议，发表了《曼谷宣言》，正式宣告东南亚国家联盟成立。', '{\"name\": \"projects/expo-9cuf/agent/intents/8b8e6e4d-baba-450d-8d84-2e1718a0a638\", \"displayName\": \"x_0_0_11\", \"priority\": 500000, \"mlEnabled\": true, \"messages\": [{\"text\": {\"text\": [\"“东盟”是“东南亚国家联盟”的简称，英文名称为Association of Southeast Asian Nations\", \" 简称ASEAN。1967年8月7日～8日，印尼、泰国、新加坡、菲律宾四国外长和马来西亚副总理在曼谷举行会议，发表了《曼谷宣言》，正式宣告东南亚国家联盟成立。\"]}}]}', 'https://dialogflow.cloud.google.com/#/agent/expo-9cuf/editIntent/8b8e6e4d-baba-450d-8d84-2e1718a0a638/', '134', '{\"exec_param\": {\"dialogflow_config\": {\"request_frequency\": 3, \"intent_name_prefix\": \"x_0_0\", \"project_id\": \"expo-9cuf\", \"language_code\": \"zh-cn\"}, \"runtime_param\": {\"ID\": 11, \"phrases_parts\": [\"“东盟”的由来\", \"介绍一下“东盟”\", \"“东盟”简介\"], \"response_texts\": [\"“东盟”是“东南亚国家联盟”的简称，英文名称为Association of Southeast Asian Nations\", \" 简称ASEAN。1967年8月7日～8日，印尼、泰国、新加坡、菲律宾四国外长和马来西亚副总理在曼谷举行会议，发表了《曼谷宣言》，正式宣告东南亚国家联盟成立。\"]}}}');
INSERT INTO `dialogflow_exec_record` VALUES (00000000320, '2021-08-19 17:23:04.226759', '“东盟”的宗旨&&介绍一下“东盟”的宗旨', '1967年8月8日发表的《东南亚国家联盟成立宣言》确定的宗旨和目标是：以平等与协作精神，共同努力促进本地区的经济增长、社会进步和文化发展；遵循正义、国家关系准则和《联合国宪章》促进本地区的和平与稳定；促进经济、社会、文化、技术及行政训练和研究设施方面互相支援；在充分利用农业和工业、扩大贸易、改善交通运输、提高人民生活水平方面进行更有效的合作；促进对东南亚问题的研究；同具有相似宗旨和目标的国际和地区组织保持紧密和互利的合作，探询更紧密的合作途径。', '{\"name\": \"projects/expo-9cuf/agent/intents/8ac1bb1d-7892-4caf-bfc7-36e7fd9941e0\", \"displayName\": \"x_0_0_12\", \"priority\": 500000, \"mlEnabled\": true, \"messages\": [{\"text\": {\"text\": [\"1967年8月8日发表的《东南亚国家联盟成立宣言》确定的宗旨和目标是：以平等与协作精神，共同努力促进本地区的经济增长、社会进步和文化发展；遵循正义、国家关系准则和《联合国宪章》促进本地区的和平与稳定；促进经济、社会、文化、技术及行政训练和研究设施方面互相支援；在充分利用农业和工业、扩大贸易、改善交通运输、提高人民生活水平方面进行更有效的合作；促进对东南亚问题的研究；同具有相似宗旨和目标的国际和地区组织保持紧密和互利的合作，探询更紧密的合作途径。\"]}}]}', 'https://dialogflow.cloud.google.com/#/agent/expo-9cuf/editIntent/8ac1bb1d-7892-4caf-bfc7-36e7fd9941e0/', '134', '{\"exec_param\": {\"dialogflow_config\": {\"request_frequency\": 3, \"intent_name_prefix\": \"x_0_0\", \"project_id\": \"expo-9cuf\", \"language_code\": \"zh-cn\"}, \"runtime_param\": {\"ID\": 12, \"phrases_parts\": [\"“东盟”的宗旨\", \"介绍一下“东盟”的宗旨\"], \"response_texts\": [\"1967年8月8日发表的《东南亚国家联盟成立宣言》确定的宗旨和目标是：以平等与协作精神，共同努力促进本地区的经济增长、社会进步和文化发展；遵循正义、国家关系准则和《联合国宪章》促进本地区的和平与稳定；促进经济、社会、文化、技术及行政训练和研究设施方面互相支援；在充分利用农业和工业、扩大贸易、改善交通运输、提高人民生活水平方面进行更有效的合作；促进对东南亚问题的研究；同具有相似宗旨和目标的国际和地区组织保持紧密和互利的合作，探询更紧密的合作途径。\"]}}}');
INSERT INTO `dialogflow_exec_record` VALUES (00000000321, '2021-08-19 17:23:07.990457', '“东盟”的成员国有哪些&&介绍一下“东盟”的成员国', '到2002年止，东盟共有十个成员国：文莱、柬埔寨、印度尼西亚、老挝、马来西亚、缅甸、菲律宾、新加坡、泰国、越南。观察员国：巴布亚新几内亚。', '{\"name\": \"projects/expo-9cuf/agent/intents/eb1fe468-cc48-4c38-9ee0-625d20e49efb\", \"displayName\": \"x_0_0_13\", \"priority\": 500000, \"mlEnabled\": true, \"messages\": [{\"text\": {\"text\": [\"到2002年止，东盟共有十个成员国：文莱、柬埔寨、印度尼西亚、老挝、马来西亚、缅甸、菲律宾、新加坡、泰国、越南。观察员国：巴布亚新几内亚。\"]}}]}', 'https://dialogflow.cloud.google.com/#/agent/expo-9cuf/editIntent/eb1fe468-cc48-4c38-9ee0-625d20e49efb/', '134', '{\"exec_param\": {\"dialogflow_config\": {\"request_frequency\": 3, \"intent_name_prefix\": \"x_0_0\", \"project_id\": \"expo-9cuf\", \"language_code\": \"zh-cn\"}, \"runtime_param\": {\"ID\": 13, \"phrases_parts\": [\"“东盟”的成员国有哪些\", \"介绍一下“东盟”的成员国\"], \"response_texts\": [\"到2002年止，东盟共有十个成员国：文莱、柬埔寨、印度尼西亚、老挝、马来西亚、缅甸、菲律宾、新加坡、泰国、越南。观察员国：巴布亚新几内亚。\"]}}}');
