INSERT INTO `dialogflow_exec_record` VALUES (00000000341, '2021-08-19 17:24:23.600416', '南宁国际会展中心地里位置&&南宁国际会展中心位于哪里&&南宁国际会展中心的方位', '会展中心北衔城市主干道民族大道，东接东盟商务区、紧邻石门森林公园，西临城市快速环路并与大型城市亲水公园—民歌湖相眺，背靠青秀山风景区。驾车前往南宁东站（高铁站）15分钟、机场40分钟。周边共有30多条公交线路经停，地铁1号线在会展中心设有同名站点，经商业中心可从馆内直达地铁站。', '{\"name\": \"projects/expo-9cuf/agent/intents/fbb1bf3b-bca9-498b-9cfe-833f401b4afa\", \"displayName\": \"x_0_0_33\", \"priority\": 500000, \"mlEnabled\": true, \"messages\": [{\"text\": {\"text\": [\"会展中心北衔城市主干道民族大道，东接东盟商务区、紧邻石门森林公园，西临城市快速环路并与大型城市亲水公园—民歌湖相眺，背靠青秀山风景区。驾车前往南宁东站（高铁站）15分钟、机场40分钟。周边共有30多条公交线路经停，地铁1号线在会展中心设有同名站点，经商业中心可从馆内直达地铁站。\"]}}]}', 'https://dialogflow.cloud.google.com/#/agent/expo-9cuf/editIntent/fbb1bf3b-bca9-498b-9cfe-833f401b4afa/', '134', '{\"exec_param\": {\"dialogflow_config\": {\"request_frequency\": 3, \"intent_name_prefix\": \"x_0_0\", \"project_id\": \"expo-9cuf\", \"language_code\": \"zh-cn\"}, \"runtime_param\": {\"ID\": 33, \"phrases_parts\": [\"南宁国际会展中心地里位置\", \"南宁国际会展中心位于哪里\", \"南宁国际会展中心的方位\"], \"response_texts\": [\"会展中心北衔城市主干道民族大道，东接东盟商务区、紧邻石门森林公园，西临城市快速环路并与大型城市亲水公园—民歌湖相眺，背靠青秀山风景区。驾车前往南宁东站（高铁站）15分钟、机场40分钟。周边共有30多条公交线路经停，地铁1号线在会展中心设有同名站点，经商业中心可从馆内直达地铁站。\"]}}}');
