INSERT INTO `dialogflow_exec_record` VALUES (00000000390, '2021-08-20 10:14:11.119433', '“东盟”的由来&&介绍一下“东盟”&&“东盟”简介', '“东盟”是“东南亚国家联盟”的简称，英文名称为Association of Southeast Asian Nations&& 简称ASEAN。1967年8月7日～8日，印尼、泰国、新加坡、菲律宾四国外长和马来西亚副总理在曼谷举行会议，发表了《曼谷宣言》，正式宣告东南亚国家联盟成立。', '{\"name\": \"projects/harix-pjyh/agent/intents/1ff53d54-9f22-46fc-9901-20b478cbbf16\", \"displayName\": \"w_0_1_2\", \"priority\": 500000, \"mlEnabled\": true, \"messages\": [{\"text\": {\"text\": [\"“东盟”是“东南亚国家联盟”的简称，英文名称为Association of Southeast Asian Nations\", \" 简称ASEAN。1967年8月7日～8日，印尼、泰国、新加坡、菲律宾四国外长和马来西亚副总理在曼谷举行会议，发表了《曼谷宣言》，正式宣告东南亚国家联盟成立。\"]}}]}', 'https://dialogflow.cloud.google.com/#/agent/harix-pjyh/editIntent/1ff53d54-9f22-46fc-9901-20b478cbbf16/', '134', '{\"exec_param\": {\"dialogflow_config\": {\"request_frequency\": 3, \"intent_name_prefix\": \"w_0_1\", \"project_id\": \"harix-pjyh\", \"language_code\": \"en\"}, \"runtime_param\": {\"ID\": 2, \"phrases_parts\": [\"“东盟”的由来\", \"介绍一下“东盟”\", \"“东盟”简介\"], \"response_texts\": [\"“东盟”是“东南亚国家联盟”的简称，英文名称为Association of Southeast Asian Nations\", \" 简称ASEAN。1967年8月7日～8日，印尼、泰国、新加坡、菲律宾四国外长和马来西亚副总理在曼谷举行会议，发表了《曼谷宣言》，正式宣告东南亚国家联盟成立。\"]}}}');
