INSERT INTO `dialogflow_exec_record` VALUES (00000000643, '2021-08-20 13:48:34.141781', '中国-东盟博览会介绍&&介绍一下中国-东盟博览会&&中国-东盟博览会简介&&介绍一下博览会', '中国-东盟博览会（China-ASEAN Expo 简称CAEXPO），简称东博会，由中国前国务院总理温家宝倡议，由中国和东盟10国经贸主管部门及东盟秘书处共同主办，广西壮族自治区人民政府承办的国家级、国际性经贸交流盛会，每年在广西壮族自治区南宁举办。', '{\"name\": \"projects/emac-mhju/agent/intents/76ec3a10-4120-4964-a697-f2944d70d650\", \"displayName\": \"intent_0_0_227\", \"priority\": 500000, \"mlEnabled\": true, \"messages\": [{\"text\": {\"text\": [\"中国-东盟博览会（China-ASEAN Expo 简称CAEXPO），简称东博会，由中国前国务院总理温家宝倡议，由中国和东盟10国经贸主管部门及东盟秘书处共同主办，广西壮族自治区人民政府承办的国家级、国际性经贸交流盛会，每年在广西壮族自治区南宁举办。\"]}}]}', 'https://dialogflow.cloud.google.com/#/agent/emac-mhju/editIntent/76ec3a10-4120-4964-a697-f2944d70d650/', '134', '{\"exec_param\": {\"dialogflow_config\": {\"request_frequency\": 10, \"intent_name_prefix\": \"intent_0_0\", \"project_id\": \"emac-mhju\", \"language_code\": \"zh-cn\"}, \"runtime_param\": {\"ID\": 227, \"phrases_parts\": [\"中国-东盟博览会介绍\", \"介绍一下中国-东盟博览会\", \"中国-东盟博览会简介\", \"介绍一下博览会\"], \"response_texts\": [\"中国-东盟博览会（China-ASEAN Expo 简称CAEXPO），简称东博会，由中国前国务院总理温家宝倡议，由中国和东盟10国经贸主管部门及东盟秘书处共同主办，广西壮族自治区人民政府承办的国家级、国际性经贸交流盛会，每年在广西壮族自治区南宁举办。\"]}}}');
INSERT INTO `dialogflow_exec_record` VALUES (00000000644, '2021-08-20 13:48:44.855950', '第18届中国-东盟博览会何时举办&&第18届中国-东盟博览会举办时间&&第18届中国-东盟博览会什么时候举办&&大会以什么形式具备的', '2021年9月，第18届中国-东盟博览会采取“实体展+云上东博会”的形式举办。', '{\"name\": \"projects/emac-mhju/agent/intents/0d7e9c2c-9e8b-4ad9-95a7-b5a2a389d505\", \"displayName\": \"intent_0_0_228\", \"priority\": 500000, \"mlEnabled\": true, \"messages\": [{\"text\": {\"text\": [\"2021年9月，第18届中国-东盟博览会采取“实体展+云上东博会”的形式举办。\"]}}]}', 'https://dialogflow.cloud.google.com/#/agent/emac-mhju/editIntent/0d7e9c2c-9e8b-4ad9-95a7-b5a2a389d505/', '134', '{\"exec_param\": {\"dialogflow_config\": {\"request_frequency\": 10, \"intent_name_prefix\": \"intent_0_0\", \"project_id\": \"emac-mhju\", \"language_code\": \"zh-cn\"}, \"runtime_param\": {\"ID\": 228, \"phrases_parts\": [\"第18届中国-东盟博览会何时举办\", \"第18届中国-东盟博览会举办时间\", \"第18届中国-东盟博览会什么时候举办\", \"大会以什么形式具备的\"], \"response_texts\": [\"2021年9月，第18届中国-东盟博览会采取“实体展+云上东博会”的形式举办。\"]}}}');
INSERT INTO `dialogflow_exec_record` VALUES (00000000645, '2021-08-20 13:48:55.654943', '中国-东盟博览会的背景&&介绍一下中国-东盟博览会的背景&&介绍一下大会的背景', '2003年10月8日，中国国务院总理温家宝在第七次中国与东盟（10+1）领导人会议上倡议，从2004年起每年在中国南宁举办中国—东盟博览会，同期举办中国—东盟商务与投资峰会。这一倡议得到了东盟10国领导人的普遍欢迎。', '{\"name\": \"projects/emac-mhju/agent/intents/b48b0807-83ab-4654-ae35-44ddd0782c52\", \"displayName\": \"intent_0_0_229\", \"priority\": 500000, \"mlEnabled\": true, \"messages\": [{\"text\": {\"text\": [\"2003年10月8日，中国国务院总理温家宝在第七次中国与东盟（10+1）领导人会议上倡议，从2004年起每年在中国南宁举办中国—东盟博览会，同期举办中国—东盟商务与投资峰会。这一倡议得到了东盟10国领导人的普遍欢迎。\"]}}]}', 'https://dialogflow.cloud.google.com/#/agent/emac-mhju/editIntent/b48b0807-83ab-4654-ae35-44ddd0782c52/', '134', '{\"exec_param\": {\"dialogflow_config\": {\"request_frequency\": 10, \"intent_name_prefix\": \"intent_0_0\", \"project_id\": \"emac-mhju\", \"language_code\": \"zh-cn\"}, \"runtime_param\": {\"ID\": 229, \"phrases_parts\": [\"中国-东盟博览会的背景\", \"介绍一下中国-东盟博览会的背景\", \"介绍一下大会的背景\"], \"response_texts\": [\"2003年10月8日，中国国务院总理温家宝在第七次中国与东盟（10+1）领导人会议上倡议，从2004年起每年在中国南宁举办中国—东盟博览会，同期举办中国—东盟商务与投资峰会。这一倡议得到了东盟10国领导人的普遍欢迎。\"]}}}');
INSERT INTO `dialogflow_exec_record` VALUES (00000000646, '2021-08-20 13:49:06.434199', '中国-东盟博览会的定位&&什么是中国-东盟博览会的定位&&大会的定位是什么', '以促进中国—东盟自由贸易区建设，共享合作与发展机遇为宗旨，围绕《中国与东盟全面经济合作框架协议》以双向互利为原则，以自由贸易区内的经贸合作为重点，面向全球开放，为各国商家共同发展提供新的机遇。', '{\"name\": \"projects/emac-mhju/agent/intents/7de4af39-900b-412d-9ba3-b4bed5a27647\", \"displayName\": \"intent_0_0_230\", \"priority\": 500000, \"mlEnabled\": true, \"messages\": [{\"text\": {\"text\": [\"以促进中国—东盟自由贸易区建设，共享合作与发展机遇为宗旨，围绕《中国与东盟全面经济合作框架协议》以双向互利为原则，以自由贸易区内的经贸合作为重点，面向全球开放，为各国商家共同发展提供新的机遇。\"]}}]}', 'https://dialogflow.cloud.google.com/#/agent/emac-mhju/editIntent/7de4af39-900b-412d-9ba3-b4bed5a27647/', '134', '{\"exec_param\": {\"dialogflow_config\": {\"request_frequency\": 10, \"intent_name_prefix\": \"intent_0_0\", \"project_id\": \"emac-mhju\", \"language_code\": \"zh-cn\"}, \"runtime_param\": {\"ID\": 230, \"phrases_parts\": [\"中国-东盟博览会的定位\", \"什么是中国-东盟博览会的定位\", \"大会的定位是什么\"], \"response_texts\": [\"以促进中国—东盟自由贸易区建设，共享合作与发展机遇为宗旨，围绕《中国与东盟全面经济合作框架协议》以双向互利为原则，以自由贸易区内的经贸合作为重点，面向全球开放，为各国商家共同发展提供新的机遇。\"]}}}');
INSERT INTO `dialogflow_exec_record` VALUES (00000000647, '2021-08-20 13:49:17.164222', '东盟博览会参展时间&&东盟博览会举办时间&&东盟博览会召开时间&&这次大会的举办时间是什么时候', '2021年9月10开始至13日结束，9月13日为公众开放日。', '{\"name\": \"projects/emac-mhju/agent/intents/13de6a50-eac8-43ea-b6dc-ebb8621e81b9\", \"displayName\": \"intent_0_0_231\", \"priority\": 500000, \"mlEnabled\": true, \"messages\": [{\"text\": {\"text\": [\"2021年9月10开始至13日结束，9月13日为公众开放日。\"]}}]}', 'https://dialogflow.cloud.google.com/#/agent/emac-mhju/editIntent/13de6a50-eac8-43ea-b6dc-ebb8621e81b9/', '134', '{\"exec_param\": {\"dialogflow_config\": {\"request_frequency\": 10, \"intent_name_prefix\": \"intent_0_0\", \"project_id\": \"emac-mhju\", \"language_code\": \"zh-cn\"}, \"runtime_param\": {\"ID\": 231, \"phrases_parts\": [\"东盟博览会参展时间\", \"东盟博览会举办时间\", \"东盟博览会召开时间\", \"这次大会的举办时间是什么时候\"], \"response_texts\": [\"2021年9月10开始至13日结束，9月13日为公众开放日。\"]}}}');
