INSERT INTO `dialogflow_exec_record` VALUES (00000000652, '2021-08-20 13:50:11.148421', '东博会特色有哪些&&东博会展会六大特色&&东博会展会有哪些特色&&本届大会的特色是什么', '1．进口与出口相结合；2．投资与引资相结合 3．商品贸易与服务贸易相结合 ；4．展会结合，相得益彰；5．既是经贸盛会，也是外交舞台；6．经贸活动与文化交流相结合 　。', '{\"name\": \"projects/emac-mhju/agent/intents/70f709d6-57c8-4db4-b14a-d53bce25f1ed\", \"displayName\": \"intent_0_0_236\", \"priority\": 500000, \"mlEnabled\": true, \"messages\": [{\"text\": {\"text\": [\"1．进口与出口相结合；2．投资与引资相结合 3．商品贸易与服务贸易相结合 ；4．展会结合，相得益彰；5．既是经贸盛会，也是外交舞台；6．经贸活动与文化交流相结合 　。\"]}}]}', 'https://dialogflow.cloud.google.com/#/agent/emac-mhju/editIntent/70f709d6-57c8-4db4-b14a-d53bce25f1ed/', '134', '{\"exec_param\": {\"dialogflow_config\": {\"request_frequency\": 10, \"intent_name_prefix\": \"intent_0_0\", \"project_id\": \"emac-mhju\", \"language_code\": \"zh-cn\"}, \"runtime_param\": {\"ID\": 236, \"phrases_parts\": [\"东博会特色有哪些\", \"东博会展会六大特色\", \"东博会展会有哪些特色\", \"本届大会的特色是什么\"], \"response_texts\": [\"1．进口与出口相结合；2．投资与引资相结合 3．商品贸易与服务贸易相结合 ；4．展会结合，相得益彰；5．既是经贸盛会，也是外交舞台；6．经贸活动与文化交流相结合 　。\"]}}}');
INSERT INTO `dialogflow_exec_record` VALUES (00000000653, '2021-08-20 13:50:21.879480', '“东盟”的由来&&介绍一下“东盟”&&“东盟”简介', '“东盟”是“东南亚国家联盟”的简称，英文名称为Association of Southeast Asian Nations&& 简称ASEAN。1967年8月7日～8日，印尼、泰国、新加坡、菲律宾四国外长和马来西亚副总理在曼谷举行会议，发表了《曼谷宣言》，正式宣告东南亚国家联盟成立。', '{\"name\": \"projects/emac-mhju/agent/intents/b3a50491-058b-4e1d-b1b6-db752f70fe0b\", \"displayName\": \"intent_0_0_237\", \"priority\": 500000, \"mlEnabled\": true, \"messages\": [{\"text\": {\"text\": [\"“东盟”是“东南亚国家联盟”的简称，英文名称为Association of Southeast Asian Nations\", \" 简称ASEAN。1967年8月7日～8日，印尼、泰国、新加坡、菲律宾四国外长和马来西亚副总理在曼谷举行会议，发表了《曼谷宣言》，正式宣告东南亚国家联盟成立。\"]}}]}', 'https://dialogflow.cloud.google.com/#/agent/emac-mhju/editIntent/b3a50491-058b-4e1d-b1b6-db752f70fe0b/', '134', '{\"exec_param\": {\"dialogflow_config\": {\"request_frequency\": 10, \"intent_name_prefix\": \"intent_0_0\", \"project_id\": \"emac-mhju\", \"language_code\": \"zh-cn\"}, \"runtime_param\": {\"ID\": 237, \"phrases_parts\": [\"“东盟”的由来\", \"介绍一下“东盟”\", \"“东盟”简介\"], \"response_texts\": [\"“东盟”是“东南亚国家联盟”的简称，英文名称为Association of Southeast Asian Nations\", \" 简称ASEAN。1967年8月7日～8日，印尼、泰国、新加坡、菲律宾四国外长和马来西亚副总理在曼谷举行会议，发表了《曼谷宣言》，正式宣告东南亚国家联盟成立。\"]}}}');
INSERT INTO `dialogflow_exec_record` VALUES (00000000654, '2021-08-20 13:50:32.680004', '“东盟”的宗旨&&介绍一下“东盟”的宗旨', '1967年8月8日发表的《东南亚国家联盟成立宣言》确定的宗旨和目标是：以平等与协作精神，共同努力促进本地区的经济增长、社会进步和文化发展；遵循正义、国家关系准则和《联合国宪章》促进本地区的和平与稳定；促进经济、社会、文化、技术及行政训练和研究设施方面互相支援；在充分利用农业和工业、扩大贸易、改善交通运输、提高人民生活水平方面进行更有效的合作；促进对东南亚问题的研究；同具有相似宗旨和目标的国际和地区组织保持紧密和互利的合作，探询更紧密的合作途径。', '{\"name\": \"projects/emac-mhju/agent/intents/dfc326da-7b4a-40c0-a9ab-1cc7dc9ea2a9\", \"displayName\": \"intent_0_0_238\", \"priority\": 500000, \"mlEnabled\": true, \"messages\": [{\"text\": {\"text\": [\"1967年8月8日发表的《东南亚国家联盟成立宣言》确定的宗旨和目标是：以平等与协作精神，共同努力促进本地区的经济增长、社会进步和文化发展；遵循正义、国家关系准则和《联合国宪章》促进本地区的和平与稳定；促进经济、社会、文化、技术及行政训练和研究设施方面互相支援；在充分利用农业和工业、扩大贸易、改善交通运输、提高人民生活水平方面进行更有效的合作；促进对东南亚问题的研究；同具有相似宗旨和目标的国际和地区组织保持紧密和互利的合作，探询更紧密的合作途径。\"]}}]}', 'https://dialogflow.cloud.google.com/#/agent/emac-mhju/editIntent/dfc326da-7b4a-40c0-a9ab-1cc7dc9ea2a9/', '134', '{\"exec_param\": {\"dialogflow_config\": {\"request_frequency\": 10, \"intent_name_prefix\": \"intent_0_0\", \"project_id\": \"emac-mhju\", \"language_code\": \"zh-cn\"}, \"runtime_param\": {\"ID\": 238, \"phrases_parts\": [\"“东盟”的宗旨\", \"介绍一下“东盟”的宗旨\"], \"response_texts\": [\"1967年8月8日发表的《东南亚国家联盟成立宣言》确定的宗旨和目标是：以平等与协作精神，共同努力促进本地区的经济增长、社会进步和文化发展；遵循正义、国家关系准则和《联合国宪章》促进本地区的和平与稳定；促进经济、社会、文化、技术及行政训练和研究设施方面互相支援；在充分利用农业和工业、扩大贸易、改善交通运输、提高人民生活水平方面进行更有效的合作；促进对东南亚问题的研究；同具有相似宗旨和目标的国际和地区组织保持紧密和互利的合作，探询更紧密的合作途径。\"]}}}');
INSERT INTO `dialogflow_exec_record` VALUES (00000000655, '2021-08-20 13:50:43.375536', '“东盟”的成员国有哪些&&介绍一下“东盟”的成员国', '到2002年止，东盟共有十个成员国：文莱、柬埔寨、印度尼西亚、老挝、马来西亚、缅甸、菲律宾、新加坡、泰国、越南。观察员国：巴布亚新几内亚。', '{\"name\": \"projects/emac-mhju/agent/intents/c097b695-2fbe-451c-81f0-f3d994cdd4ab\", \"displayName\": \"intent_0_0_239\", \"priority\": 500000, \"mlEnabled\": true, \"messages\": [{\"text\": {\"text\": [\"到2002年止，东盟共有十个成员国：文莱、柬埔寨、印度尼西亚、老挝、马来西亚、缅甸、菲律宾、新加坡、泰国、越南。观察员国：巴布亚新几内亚。\"]}}]}', 'https://dialogflow.cloud.google.com/#/agent/emac-mhju/editIntent/c097b695-2fbe-451c-81f0-f3d994cdd4ab/', '134', '{\"exec_param\": {\"dialogflow_config\": {\"request_frequency\": 10, \"intent_name_prefix\": \"intent_0_0\", \"project_id\": \"emac-mhju\", \"language_code\": \"zh-cn\"}, \"runtime_param\": {\"ID\": 239, \"phrases_parts\": [\"“东盟”的成员国有哪些\", \"介绍一下“东盟”的成员国\"], \"response_texts\": [\"到2002年止，东盟共有十个成员国：文莱、柬埔寨、印度尼西亚、老挝、马来西亚、缅甸、菲律宾、新加坡、泰国、越南。观察员国：巴布亚新几内亚。\"]}}}');
