INSERT INTO `dialogflow_exec_record` VALUES (00000000691, '2021-08-20 13:57:11.751287', '常办常新，第18届东博会“新”在哪？&&介绍一下常办常新，第18届东博会“新”在哪？', '据了解，今年东博会将释放政策新红利，举办中国-东盟多式联运联盟论坛、中国（广西）自由贸易试验区推介会等系列经贸活动，增加中国石化“易享节”等零售连锁经营新业态的展示内容。同时，组织面向东盟开放的国内园区参展，举办东盟产业园区招商大会等活动，邀请日本、韩国、新西兰等RCEP成员国企业参展参会，设置专门展区，举办RCEP培训活动；邀请“一带一路”沿线更多国家的企业参展参会，推动东博会从服务“10+1”向服务RCEP和“一带一路”拓展。', '{\"name\": \"projects/emac-mhju/agent/intents/01459dd8-7721-4d73-8413-0c9777ddc46e\", \"displayName\": \"intent_0_0_275\", \"priority\": 500000, \"mlEnabled\": true, \"messages\": [{\"text\": {\"text\": [\"据了解，今年东博会将释放政策新红利，举办中国-东盟多式联运联盟论坛、中国（广西）自由贸易试验区推介会等系列经贸活动，增加中国石化“易享节”等零售连锁经营新业态的展示内容。同时，组织面向东盟开放的国内园区参展，举办东盟产业园区招商大会等活动，邀请日本、韩国、新西兰等RCEP成员国企业参展参会，设置专门展区，举办RCEP培训活动；邀请“一带一路”沿线更多国家的企业参展参会，推动东博会从服务“10+1”向服务RCEP和“一带一路”拓展。\"]}}]}', 'https://dialogflow.cloud.google.com/#/agent/emac-mhju/editIntent/01459dd8-7721-4d73-8413-0c9777ddc46e/', '134', '{\"exec_param\": {\"dialogflow_config\": {\"request_frequency\": 10, \"intent_name_prefix\": \"intent_0_0\", \"project_id\": \"emac-mhju\", \"language_code\": \"zh-cn\"}, \"runtime_param\": {\"ID\": 275, \"phrases_parts\": [\"常办常新，第18届东博会“新”在哪？\", \"介绍一下常办常新，第18届东博会“新”在哪？\"], \"response_texts\": [\"据了解，今年东博会将释放政策新红利，举办中国-东盟多式联运联盟论坛、中国（广西）自由贸易试验区推介会等系列经贸活动，增加中国石化“易享节”等零售连锁经营新业态的展示内容。同时，组织面向东盟开放的国内园区参展，举办东盟产业园区招商大会等活动，邀请日本、韩国、新西兰等RCEP成员国企业参展参会，设置专门展区，举办RCEP培训活动；邀请“一带一路”沿线更多国家的企业参展参会，推动东博会从服务“10+1”向服务RCEP和“一带一路”拓展。\"]}}}');
