INSERT INTO `dialogflow_exec_record` VALUES (00000000696, '2021-08-20 13:58:05.603773', '东博会对推动多领域合作起到哪些作用&&东博会对推动多领域合作起到什么作用', '东博会根据“一带一路”建设需要举办一系列会议论坛，涵盖海关、检验检疫、金融、港口、物流、文化、科技、教育等40多个领域，实现了部长级磋商以及政府官员、企业家、专家学者、社会各界知名人士之间的对话沟通，建立起多领域合作机制，带动了中国—东盟信息港、中国—东盟港口城市合作网络、中国—东盟技术转移中心、中国—东盟企业家联合会、中国—东盟青年联谊会、中国—东盟教育培训中心等重大项目落地，成为了中国—东盟多领域合作的权威性较强、认可度较高的“南宁渠道”。', '{\"name\": \"projects/emac-mhju/agent/intents/0e18d4fa-b8dd-4f86-b199-f9e2073a6518\", \"displayName\": \"intent_0_0_280\", \"priority\": 500000, \"mlEnabled\": true, \"messages\": [{\"text\": {\"text\": [\"东博会根据“一带一路”建设需要举办一系列会议论坛，涵盖海关、检验检疫、金融、港口、物流、文化、科技、教育等40多个领域，实现了部长级磋商以及政府官员、企业家、专家学者、社会各界知名人士之间的对话沟通，建立起多领域合作机制，带动了中国—东盟信息港、中国—东盟港口城市合作网络、中国—东盟技术转移中心、中国—东盟企业家联合会、中国—东盟青年联谊会、中国—东盟教育培训中心等重大项目落地，成为了中国—东盟多领域合作的权威性较强、认可度较高的“南宁渠道”。\"]}}]}', 'https://dialogflow.cloud.google.com/#/agent/emac-mhju/editIntent/0e18d4fa-b8dd-4f86-b199-f9e2073a6518/', '134', '{\"exec_param\": {\"dialogflow_config\": {\"request_frequency\": 10, \"intent_name_prefix\": \"intent_0_0\", \"project_id\": \"emac-mhju\", \"language_code\": \"zh-cn\"}, \"runtime_param\": {\"ID\": 280, \"phrases_parts\": [\"东博会对推动多领域合作起到哪些作用\", \"东博会对推动多领域合作起到什么作用\"], \"response_texts\": [\"东博会根据“一带一路”建设需要举办一系列会议论坛，涵盖海关、检验检疫、金融、港口、物流、文化、科技、教育等40多个领域，实现了部长级磋商以及政府官员、企业家、专家学者、社会各界知名人士之间的对话沟通，建立起多领域合作机制，带动了中国—东盟信息港、中国—东盟港口城市合作网络、中国—东盟技术转移中心、中国—东盟企业家联合会、中国—东盟青年联谊会、中国—东盟教育培训中心等重大项目落地，成为了中国—东盟多领域合作的权威性较强、认可度较高的“南宁渠道”。\"]}}}');
