INSERT INTO `dialogflow_exec_record` VALUES (00000000700, '2021-08-20 13:58:48.964178', '怎么让展会结合&&介绍一下展会结合&&展会结合体现在哪', '会期既有展览、洽谈、推介、签约等活动，又有政府官员、企业家、专家学者参加的高层论坛。“展”和“会”相互促进，交相辉映。', '{\"name\": \"projects/emac-mhju/agent/intents/b9050cad-8790-4f6b-9070-ef86541c1da0\", \"displayName\": \"intent_0_0_284\", \"priority\": 500000, \"mlEnabled\": true, \"messages\": [{\"text\": {\"text\": [\"会期既有展览、洽谈、推介、签约等活动，又有政府官员、企业家、专家学者参加的高层论坛。“展”和“会”相互促进，交相辉映。\"]}}]}', 'https://dialogflow.cloud.google.com/#/agent/emac-mhju/editIntent/b9050cad-8790-4f6b-9070-ef86541c1da0/', '134', '{\"exec_param\": {\"dialogflow_config\": {\"request_frequency\": 10, \"intent_name_prefix\": \"intent_0_0\", \"project_id\": \"emac-mhju\", \"language_code\": \"zh-cn\"}, \"runtime_param\": {\"ID\": 284, \"phrases_parts\": [\"怎么让展会结合\", \"介绍一下展会结合\", \"展会结合体现在哪\"], \"response_texts\": [\"会期既有展览、洽谈、推介、签约等活动，又有政府官员、企业家、专家学者参加的高层论坛。“展”和“会”相互促进，交相辉映。\"]}}}');
