INSERT INTO `dialogflow_exec_record` VALUES (00000000714, '2021-08-20 16:20:05.871432', '“东盟”的由来&&介绍一下“东盟”&&“东盟”简介', '“东盟”是“东南亚国家联盟”的简称，英文名称为Association of Southeast Asian Nations&& 简称ASEAN。1967年8月7日～8日，印尼、泰国、新加坡、菲律宾四国外长和马来西亚副总理在曼谷举行会议，发表了《曼谷宣言》，正式宣告东南亚国家联盟成立。', '{\"name\": \"projects/mytest1-ybmeip/agent/intents/41dc997c-8ccd-4838-be3a-a6a8f144d2a0\", \"displayName\": \"intent_111_2\", \"priority\": 500000, \"mlEnabled\": true, \"messages\": [{\"text\": {\"text\": [\"“东盟”是“东南亚国家联盟”的简称，英文名称为Association of Southeast Asian Nations\", \" 简称ASEAN。1967年8月7日～8日，印尼、泰国、新加坡、菲律宾四国外长和马来西亚副总理在曼谷举行会议，发表了《曼谷宣言》，正式宣告东南亚国家联盟成立。\"]}}]}', 'https://dialogflow.cloud.google.com/#/agent/mytest1-ybmeip/editIntent/41dc997c-8ccd-4838-be3a-a6a8f144d2a0/', '134', '{\"exec_param\": {\"dialogflow_config\": {\"request_frequency\": 3, \"intent_name_prefix\": \"intent_111\", \"project_id\": \"mytest1-ybmeip\", \"language_code\": \"zh-CN\"}, \"runtime_param\": {\"ID\": 2, \"phrases_parts\": [\"“东盟”的由来\", \"介绍一下“东盟”\", \"“东盟”简介\"], \"response_texts\": [\"“东盟”是“东南亚国家联盟”的简称，英文名称为Association of Southeast Asian Nations\", \" 简称ASEAN。1967年8月7日～8日，印尼、泰国、新加坡、菲律宾四国外长和马来西亚副总理在曼谷举行会议，发表了《曼谷宣言》，正式宣告东南亚国家联盟成立。\"]}}}');
